import React from 'react'

function Banner() {
  return (
    <div className="container p-5"> 
     <div>
      <h2 className='letter-spacing'><span className="bold">IFO</span>:<span className="thin"> Initial Farm Offerings</span>
      </h2>
      <p>Buy new tokens launching on Chain</p>
     </div>
    </div>
  )
}

export default Banner
